def convert_daily_rate(rate, unit):

    if unit == 'h':
        return rate / 24.0
    if unit == 'd':
        return rate
    if unit == 'w':
        return rate * 7.0
    if unit == 'm':
        return rate * 30.0
    if unit == 'y':
        return rate * 365.0

