def rotate_delta(delta, index):

    dx, dy, dz = delta
    if index == 0:
        return delta
    elif index == 1:
        return dx, -dz, dy
    elif index == 2:
        return dx, -dy, -dz
    elif index == 3:
        return dx, dz, -dy
    elif index == 4:
        return -dy, dx, dz
    elif index == 5:
        return dz, dx, dy
    elif index == 6:
        return dy, dx, -dz
    elif index == 7:
        return -dz, dx, -dy
    elif index == 8:
        return -dx, -dy, dz
    elif index == 9:
        return -dx, dz, dy
    elif index == 10:
        return -dx, dy, -dz
    elif index == 11:
        return -dx, -dz, -dy
    elif index == 12:
        return dy, -dx, dz
    elif index == 13:
        return -dz, -dx, dy
    elif index == 14:
