def add_price(price: float, man_value: float, reduce_value: float):

    num = 1
    if price <= 0:
        return price
    temp_price = price
    while True:
        if temp_price >= man_value:
            break
        num += 1
        temp_price = price * num
    fin_price = ((price * num) - reduce_value) / num
    return fin_price

