def get_digits_from_right_to_left(number):


    number = abs(number)

    if number < 10:
        return (number, )

    lst = list()

    while number:
        number, digit = divmod(number, 10)
        lst.insert(0, digit)

    return tuple(lst)

def image_size(size):

    l_max = max(size)
    if l_max > 300:
        num = l_max/300
    else:
        num = 1
    w = round(size[0] / num)
    h = round(size[1] / num)
    new_size = [w, h]
    return new_size

